// src/components/SermonCard.js
import React from 'react';

const SermonCard = ({ title, speaker, date, description }) => {
  return (
    <div className="sermon-card">
      <h3>{title}</h3>
      <p>By: {speaker}</p>
      <p>Date: {date}</p>
      <p>{description}</p>
      <button>Watch Now</button>
    </div>
  );
};

export default SermonCard;
